import React from 'react';
import './App.css';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'
// import Register from './Register';
import FFheader from './components/Jsx-section/FFheader';
import FFabout from './components/Jsx-section/FFabout';
import FFservice from './components/Jsx-section/FFservice';
import FFtrainer from './components/Jsx-section/FFtrainer';
import FFfooter from './components/Jsx-section/FFfooter';
import Navbar from './components/Jsx-section/Navbar';
import './components/Css-section/FFheader'
import './components/Css-section/FFabout.css';
import './components/Css-section/FFservice.css';
import './components/Css-section/FFtrainer.css';
import './components/Css-section/FFfooter.css';
import './components/Css-section/Navbar.css';
import '../src/index.css';

const App = () => {
  return (
    <>
    <Navbar/>
    <FFheader/>
    <FFabout/>  
    <FFservice/>
    <FFtrainer/>
    <FFfooter/>
    </>

  );
}

export default App;
